import Header from './Header';
import UHeader from './Uheader/UHeader';
import Footer from './Footer/Footer';
import Banner from './Banner/Banner';

const LayoutB = ({ children }) => {
    return (
        <React.Fragment>

            <Header />
            <Banner />
            {children}
            <Footer />
        </React.Fragment>
    );
};

export default LayoutB;
